import React, { useState, useEffect } from "react";


const TrackInfo = ({track}) => {

  return(
  <div className="card">
  <img src={track.album.images[1].url} alt="Track" />
  <div className="containerCard">
    <h4><b>{track.artists.map((e) => e.name).join(", ")}</b></h4>
    <p>{track.name}</p>
  </div>
</div>
)

}

export default TrackInfo;
